Δεδομένου ότι Η σύνθεση μελών αποτελείται από τριάντα και πενήντα ενηλίκους άνδρες ανά τμήμα (που ονομάζονται moradas) και χωρίστηκαν σε δύο κοινά μέλη, που ονομάζονται hermanos disciplantes (πειθαρχημένα αδέρφια), και αξιωματικοί, που ονομάζονται hermanos de luz (αδέρφια του φωτός). Επομένως, πρέπει να ισχύει ότι "Τα παραρτήματα είχαν τόσο απλά μέλη όσο και στελέχη."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Στο φυσικό περιβάλλον, η εικόνα, η μετάλλαξη, ο ανασυνδυασμός και η επιλογή μπορούν να συνωμοτήσουν για να τραβήξουν τους εξελισσόμενους πληθυσμούς προς τα πάνω προς τις κορυφές της υψηλής φυσικής κατάστασης. Επομένως, πρέπει να ισχύει ότι "Σε υψηλότερα επίπεδα φυσικής κατάστασης, οι πληθυσμοί που εξελίσσονται είναι πιο πιθανό να επιβιώσουν."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Αυτά μπορεί να περιλαμβάνουν απρόβλεπτες ευκαιρίες για την ενίσχυση της μάθησης των σπουδαστών και των διδασκόντων, προσκαλώντας ειδικούς επισκέπτες και μελετητές στην πανεπιστημιούπολη όταν βρίσκονται στην πολιτεία. Επομένως, πρέπει να ισχύει ότι "Οι φοιτητές δεν μαθαίνουν τίποτα από την επίσκεψη στο χώρο του Πανεπιστημίου."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
